import React from "react";
import "./App.css";
import About from "./About";
import Portfolio from "./Portfolio";
import Nav from "./Nav";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Routes,
} from "react-router-dom";

function App() {
  return (
    <div>
      <Router>
        <Nav />
        <Route path="/about" component={About} />
        <About />
      </Router>
    </div>
  );
}

export default App;
